import React from "react";
import TopNav from '../components/TopNav/TopNav';
import Button from '../components/Button/Button';

const Goods = () => {
    return (
        <div>
            <TopNav />
            <h1>Goods</h1>
            <Link to="/">
                <button>홈으로 이동</button>
            </Link>
        </div>
    );  
} 

export default Goods;
